import React from 'react';
import './App.css';
import Header from './components/Header';
import Palette from './components/Palette';
import Advertisement from './components/Advertisement';
import Buttons from './components/Buttons';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="palettes">
        <Palette title="Material UI Colors" paletteId="material-ui-colors" />
        <Palette title="Flat UI Colors v1" paletteId="flat-ui-colors-v1" />
        <Palette title="Flat UI Colors Dutch" paletteId="flat-ui-colors-dutch" />
        <Palette title="Flat UI Colors American" paletteId="flat-ui-colors-american" />
        <Palette title="Flat UI Colors Aussie" paletteId="flat-ui-colors-aussie" />
        <Palette title="Flat UI Colors British" paletteId="flat-ui-colors-british" />
        <Palette title="Flat UI Colors Spanish" paletteId="flat-ui-colors-spanish" />
        <Palette title="Flat UI Colors Indian" paletteId="flat-ui-colors-indian" />
        <Palette title="Flat UI Colors French" paletteId="flat-ui-colors-french" />
      </div>
    </div>
  );
}

export default App;
